①：Activate 1 of these effects (but you can only use each of these effects of this card's name once per turn);
● Add 1 "Tri-Brigade" Spell/Trap from your Deck to your hand, except "Tri-Brigade Hammer".
● Banish any number of "Tri-Brigade" cards from your GY; Special Summon 1 "Tri-Brigade" Link Monster from your Extra Deck with a Link Rating equal to the number banished, ignoring its Summoning conditions, also you cannot Special Summon from the Extra Deck for the rest of this turn, except Beast, Beast-Warrior, and Winged Beast monsters.

①：Activate 1 of these effects (but you can only choose each effect of this card's name once per turn);
● If you control a "Hecahands" monster: Target 1 Spell/Trap your opponent controls; return it to the hand.
● Fusion Summon 1 "Hecahands" Fusion Monster from your Extra Deck, by banishing its material from your field and/or GY. If you use face-up monsters you control owned by your opponent, you can treat them as "Hecahands" monsters.

①：Activate 1 of these effects (but you can only use each of these effects of this card's name once per turn);
● Add 1 WATER Dinosaur monster from your Deck to your hand, then, if your opponent controls a monster, you can Special Summon the added monster.
● Tribute 1 monster; Special Summon 1 Level 6 or higher FIRE monster from your hand, Deck, or GY, but its effects are negated unless it is Fiend monster.
